<?php
/**
 * Map Block Template
 *
 * @package JLBPartners
 *
 * @param array  $block The block settings and attributes.
 * @param string $content The block inner HTML (empty).
 * @param bool   $is_preview True during AJAX preview.
 * @param int    $post_id The post ID this block is saved to.
 */

// Exit if accessed directly.
if ( ! defined( 'ABSPATH' ) ) {
	exit;
}

// Define the 6 fixed locations with their map region IDs
$locations_config = array(
	'dfw_houston' => array(
		'label'      => 'DFW/Houston',
		'map_region_id' => 'map-region-dfw-houston',
	),
	'austin'       => array(
		'label'      => 'Austin',
		'map_region_id' => 'map-region-austin',
	),
	'metro_dc'     => array(
		'label'      => 'Metro DC',
		'map_region_id' => 'map-region-metro-dc',
	),
	'boston'       => array(
		'label'      => 'Boston',
		'map_region_id' => 'map-region-boston',
	),
	'phoenix'      => array(
		'label'      => 'Phoenix',
		'map_region_id' => 'map-region-phoenix',
	),
	'atlanta'      => array(
		'label'      => 'Atlanta',
		'map_region_id' => 'map-region-atlanta',
	),
);

// Map location keys to region IDs for the location blocks section
$location_region_map = array(
	'dfw_houston' => 'region-1',
	'austin'      => 'region-2',
	'metro_dc'    => 'region-3',
	'boston'      => 'region-4',
	'phoenix'     => 'region-5',
	'atlanta'     => 'region-6',
);

// Define the fixed order of location keys (based on card position)
$fixed_location_order = array(
	'dfw_houston',
	'austin',
	'metro_dc',
	'boston',
	'phoenix',
	'atlanta',
);

// Get field values from repeater
$has_content = false;
$location_data = array();
$location_cards = get_field( 'location_cards' );

if ( ! empty( $location_cards ) && is_array( $location_cards ) ) {
	// Process cards in order and map to fixed location keys based on position
	foreach ( $location_cards as $index => $card ) {
		// Get the fixed location key based on card position (0-based index)
		if ( ! isset( $fixed_location_order[ $index ] ) ) {
			continue;
		}
		
		$fixed_location_key = $fixed_location_order[ $index ];
		
		// Skip if this location key is not in our config
		if ( ! isset( $locations_config[ $fixed_location_key ] ) ) {
			continue;
		}
		
		$config = $locations_config[ $fixed_location_key ];
		
		if ( ! empty( $card['title'] ) ) {
			$has_content = true;
			
			$location_data[ $fixed_location_key ] = array(
				'title'            => ! empty( $card['title'] ) ? $card['title'] : '',
				'name'             => ! empty( $card['name'] ) ? $card['name'] : '',
				'subtitle'         => ! empty( $card['subtitle'] ) ? $card['subtitle'] : '',
				'content_info_title' => ! empty( $card['content_info_title'] ) ? $card['content_info_title'] : '',
				'content_info'     => ! empty( $card['content_info'] ) ? $card['content_info'] : '',
				'cta'              => ! empty( $card['cta'] ) ? $card['cta'] : '',
				'map_region_id'   => $config['map_region_id'],
				'region_id'       => isset( $location_region_map[ $fixed_location_key ] ) ? $location_region_map[ $fixed_location_key ] : '',
			);
		}
	}
}

// Create block attributes.
$block_id = 'map-block-' . $block['id'];
if ( ! empty( $block['anchor'] ) ) {
	$block_id = $block['anchor'];
}

$class_name = 'section section--light section--map';
if ( ! empty( $block['className'] ) ) {
	$class_name .= ' ' . $block['className'];
}

// Preview mode handling.
if ( $is_preview && ! $has_content ) {
	jlbpartners_show_block_preview( 'map-block', __( 'Map Block', 'jlbpartners' ) );
	return;
}

// Skip rendering if no content.
if ( ! $has_content ) {
	return;
}
?>
