				foreach ( $fixed_location_order as $location_key ) :
					if ( ! isset( $location_data[ $location_key ] ) ) {
						continue;
					}
					$data = $location_data[ $location_key ];
					if ( ! empty( $data['region_id'] ) ) :
						?>
						<div class="map-content__item">
							<div class="jlb location-block js-location-block" data-region="<?php echo esc_attr( $data['region_id'] ); ?>">
								<header class="js-location-header">
									<h3><?php echo esc_html( $data['title'] ); ?></h3>
									<i class="location-block__toggle"></i>
								</header>
								<article class="js-location-content">
									<div class="location-block__row">
										<div class="location-block__col location-block__col--bio">
											<?php if ( ! empty( $data['name'] ) ) : ?>
												<strong><?php echo esc_html( $data['name'] ); ?></strong>
											<?php endif; ?>
											<?php if ( ! empty( $data['subtitle'] ) ) : ?>
												<p><?php echo esc_html( $data['subtitle'] ); ?></p>
											<?php endif; ?>
											<?php if ( ! empty( $data['cta'] ) && is_array( $data['cta'] ) ) : ?>
												<?php
												$cta_url    = isset( $data['cta']['url'] ) ? $data['cta']['url'] : '';
												$cta_title  = isset( $data['cta']['title'] ) ? $data['cta']['title'] : 'Contact';
												$cta_target = isset( $data['cta']['target'] ) ? $data['cta']['target'] : '_self';
												?>
												<a 
													class="l-btn l-btn--tiny l-btn--secondary-outline" 
													href="<?php echo esc_url( $cta_url ); ?>"
													target="<?php echo esc_attr( $cta_target ); ?>"
													<?php if ( '_blank' === $cta_target ) : ?>
														rel="noopener noreferrer"
													<?php endif; ?>
												>
													<?php echo esc_html( $cta_title ); ?>
												</a>
											<?php endif; ?>
										</div>
										<div class="location-block__col location-block__col--info">
											<?php if ( ! empty( $data['content_info_title'] ) ) : ?>
												<strong><?php echo esc_html( $data['content_info_title'] ); ?></strong>
											<?php endif; ?>
											<?php if ( ! empty( $data['content_info'] ) ) : ?>
												<address>
													<?php echo wp_kses_post( $data['content_info'] ); ?>
												</address>
											<?php endif; ?>
										</div>
									</div>
								</article>
							</div>
						</div>
